import React, { useCallback } from 'react';
import styled from 'styled-components';
import { useDispatch, useSelector } from 'react-redux';
import { Button, Row, Col } from 'antd';
import Router from 'next/router';
import Link from 'next/link';
import AppHeader from './AppHeader';
const AppLayout = ({ left, content, right }) => {
	return (
		<>
			<AppHeader></AppHeader>
			<main>
				<Row>
					{/* 좌측 */}
					<Col
						xs={{ span: 0, offset: 0 }}
						sm={{ span: 0, offset: 0 }}
						md={{ span: 4, offset: 0 }}
						xl={{ span: 3, offset: 3 }}
					>
						{left}
					</Col>
					{/* 중간 */}
					<Col
						xs={{ span: 0, offset: 0 }}
						sm={{ span: 0, offset: 0 }}
						md={{ span: 20, offset: 0 }}
						xl={{ span: 18, offset: 0 }}
					>
						{content}
					</Col>
					{/* 우측 */}
					<Col>{right}</Col>
				</Row>
			</main>
		</>
	);
};

export default AppLayout;
